{
  "name": "klaussilveira/gitlist",
  "description": "An elegant git repository viewer",
  "keywords": ["scm", "vcs", "git", "repository", "github", "gitweb"],
  "type": "project",
  "license": "BSD-3-Clause",
  "require": {
    "php": ">=8.1",
    "ext-iconv": "*",
    "ext-mbstring": "*",
    "league/commonmark": "^2.4",
    "nesbot/carbon": "^2.71",
    "symfony/asset": "^6.3",
    "symfony/cache": "^6.3",
    "symfony/console": "^6.3",
    "symfony/form": "^6.3",
    "symfony/framework-bundle": "^6.3",
    "symfony/monolog-bundle": "^3.10",
    "symfony/process": "^6.3",
    "symfony/string": "^6.3",
    "symfony/templating": "^6.3",
    "symfony/translation": "^6.3",
    "symfony/twig-bundle": "^6.3",
    "symfony/webpack-encore-bundle": "^2.1",
    "symfony/yaml": "^6.3"
  },
  "require-dev": {
    "friendsofphp/php-cs-fixer": "^3.38",
    "phpspec/prophecy-phpunit": "^2.0",
    "phpstan/phpstan": "^1.10",
    "phpunit/phpunit": "^9.6",
    "symfony/debug-bundle": "^6.3",
    "symfony/dotenv": "^6.3"
  },
  "config": {
    "preferred-install": {
      "*": "dist"
    },
    "sort-packages": true,
    "process-timeout": 0
  },
  "autoload": {
    "psr-4": {
      "GitList\\": "src/"
    }
  },
  "scripts": {
    "auto-scripts": [
      "bin/console cache:clear",
      "bin/console assets:install --symlink --relative public"
    ],
    "post-install-cmd": [
      "@auto-scripts"
    ],
    "post-update-cmd": [
      "@auto-scripts"
    ],
    "test": [
      "@cs",
      "@unit",
      "@lint",
      "@stan"
    ],
    "format": [
      "vendor/bin/php-cs-fixer fix -v --show-progress=dots"
    ],
    "lint": [
      "bin/console lint:twig assets/themes/",
      "bin/console lint:yaml assets/translations/",
      "bin/console lint:yaml config/",
      "find src -name '*.php' -print0 | xargs -0 -n1 -P8 php -l"
    ],
    "cs": [
      "vendor/bin/php-cs-fixer fix --dry-run -v --show-progress=dots"
    ],
    "unit": [
      "vendor/bin/phpunit"
    ],
    "stan": [
      "vendor/bin/phpstan analyse -c phpstan.neon -l 5 src/"
    ]
  },
  "conflict": {
    "symfony/symfony": "*"
  },
  "extra": {
    "symfony": {
      "allow-contrib": false
    }
  }
}

